(1, 'PROMO TIM VISION con decoder', 5, 0, 'Con TIMvision puoi scegliere tra cinema, serie tv, cartoni e documentari, gli ultimi 7 giorni dei principali canali Rai, La7 e l’archivio La7, dove e quando vuoi.\r\n\r\nPiù di 8.000 titoli disponibili, sempre on demand, in un solo abbonamento mensile, per creare il tuo palinsesto senza interruzioni pubblicitarie.\r\n\r\nIn più, nella sezione Videostore, trovi gli ultimi successi cinematografici con un catalogo sempre aggiornato, da noleggiare o acquistare in qualsiasi momento anche senza abbonamento.\r\n\r\nPer non interrompere la tua maratona, puoi guardare TIMvision anche sul web, su smartphone e tablet senza consumare GB, e su Smart TV, inserendo le credenziali scelte al momento della registrazione al servizio.', 'Cartoni, cinema e serie TV, dove e quando vuoi', '<table class="table table-striped table-hover ">\r\n	    \r\n	    <tbody>\r\n	    	\r\n			     <tr>\r\n			     	\r\n			         	<td>\r\n				         		\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n									Contributo di attivazione\r\n								\r\n							\r\n			         	</td>\r\n			        \r\n			         	<td>\r\n				         		\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n									nessuno\r\n								\r\n							\r\n			         	</td>\r\n			        \r\n			         	<td>\r\n				         		\r\n								\r\n								\r\n								\r\n								\r\n								\r\n								\r\n							\r\n			         	</td>\r\n			        \r\n			         	<thead>\r\n	    	<tr>\r\n			    \r\n			    	<th class="col-sm-3">\r\n				    		\r\n							\r\n							\r\n							\r\n							\r\n							\r\n							\r\n							\r\n							\r\n							\r\n							\r\n							\r\n							\r\n							\r\n								Voci di Costo\r\n							\r\n						\r\n			    	</th>\r\n			    \r\n			    	<th class="c